import React from "react";
import "@coreui/coreui/dist/css/coreui.min.css";
import {
    CRow,
    CCol,
    CFormInput
} from "@coreui/react";
const Login = () => {
  return (
    <>
    

    <CRow>
  <CCol xs>
    <CFormInput placeholder="First name" aria-label="First name"/>
  </CCol>
  <CCol xs>
    <CFormInput placeholder="Last name" aria-label="Last name"/>
  </CCol>
</CRow>
    </>
  );
};

export default Login;
